import React from 'react';

const Services = () => {
  const services = [
    {
      title: 'Kitchen Remodeling',
      description: 'Modernize your kitchen with expert craftsmanship and attention to detail. We handle everything from design to installation.',
      features: [
        'Complete kitchen renovations',
        'Custom cabinetry',
        'Appliance installation',
        'Backsplash installation',
        'Countertop replacement'
      ]
    },
    {
      title: 'Bathroom Renovation',
      description: 'Transform your bathroom into a luxurious retreat with our comprehensive renovation services.',
      features: [
        'Complete bathroom remodels',
        'Custom vanities',
        'Tile installation',
        'Plumbing upgrades',
        'Lighting design'
      ]
    },
    {
      title: 'Home Additions',
      description: 'Expand your living space with custom home additions that fit your needs and style.',
      features: [
        'Sunrooms',
        'Master suites',
        'Garage conversions',
        'Deck and patio construction',
        'Basement finishing'
      ]
    },
    {
      title: 'Deck & Patio',
      description: 'Create an outdoor living space that extends your home and enhances your lifestyle.',
      features: [
        'Custom deck design',
        'Patio construction',
        'Outdoor kitchens',
        'Fire pits',
        'Landscaping integration'
      ]
    },
    {
      title: 'Roofing Services',
      description: 'Protect your home with our professional roofing services and expert installation.',
      features: [
        'Roof replacement',
        'Gutter installation',
        'Skylight installation',
        'Roof repairs',
        'Insurance claims assistance'
      ]
    },
    {
      title: 'Basement Finishing',
      description: 'Transform your basement into a functional living space with our comprehensive finishing services.',
      features: [
        'Full basement renovations',
        'Wet bar installation',
        'Home theater setup',
        'Bathroom additions',
        'Storage solutions'
      ]
    }
  ];

  return (
    <div className="py-20">
      <div className="max-w-6xl mx-auto px-4">
        <h1 className="text-4xl font-bold text-center mb-12">Our Services</h1>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {services.map((service, index) => (
            <div key={index} className="bg-white rounded-lg shadow-lg p-6">
              <h2 className="text-2xl font-bold mb-4">{service.title}</h2>
              <p className="text-gray-600 mb-6">{service.description}</p>
              <div className="space-y-2">
                {service.features.map((feature, idx) => (
                  <div key={idx} className="flex items-center">
                    <svg className="w-4 h-4 text-primary mr-2" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M5 13l4 4L19 7" />
                    </svg>
                    <span className="text-gray-600">{feature}</span>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Services;
